import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ListaConductores from './views/Conductores/ListaConductores';
import ConductoresDisponibles from './views/Conductores/ConductoresDisponibles';
import ConductoresCercanos from './views/Conductores/ConductoresCercanos';
import BuscarConductor from './views/Conductores/BuscarConductor';
import RegistroPasajero from './views/Pasajeros/RegistroPasajero';
import ListaPasajeros from './views/Pasajeros/ListaPasajeros';
import SolicitarViaje from './views/Pasajeros/SolicitarViaje';
import SolicitudViaje from './views/Viajes/SolicitudViaje';
import ViajesCompletados from './views/Viajes/ViajesCompletados';
import CompletarViaje from './views/Viajes/CompletarViaje';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={ListaConductores} />
        <Route path="/conductores-disponibles" component={ConductoresDisponibles} />
        <Route path="/conductores-cercanos" component={ConductoresCercanos} />
        <Route path="/buscar-conductor" component={BuscarConductor} />
        <Route path="/registro-pasajero" component={RegistroPasajero} />
        <Route path="/lista-pasajeros" component={ListaPasajeros} />
        <Route path="/solicitar-viaje" component={SolicitarViaje} />
        <Route path="/solicitud-viaje" component={SolicitudViaje} />
        <Route path="/viajes-completados" component={ViajesCompletados} />
        <Route path="/completar-viaje/:id" component={CompletarViaje} />
      </Switch>
    </Router>
  );
}

export default App;
